import React from 'react';
import './App.css';
import Body from './Body';
import Header from './Header';
import logo from '../src/logo.svg';

const App = () => {
  return (
    <div className="App">
      <Header />
      <div className="container">
        <Body>Eu sou Cristiano</Body>
        <img src={logo} alt="logo" />
      </div>
    </div>
  );
}

export default App;
